import React, { useState } from 'react'

export default function TodoList() {
    const [formData,SubmitFormData]=useState({
        time:"",
        note:""
    })

    const[TableData,SubmitTable]=use
    function HandleForm(e){
        const {name,value}=e.target
        SubmitFormData({...formData,[name]:value});
    }
    function HandleSubmit(){
        SubmitTable([...TableData,formData]);
        SubmitFormData({
            time:"",
            note:""
        })
    }
  return (
    <div>
        <h1>TodoList</h1>
        <div id="form">
            <input type="time" type="time" value={formData.time} onChange={HandleForm}/>
            <input type="note" type="text" value={formData.note} onChange={HandleForm}/>
            <br/>
            <button onClick={HandleSubmit}>Submit</button>
        </div>
    </div>
  )
}
